eristikas. Jūs nustatote šias charakteristikas pridėdami savo grupių deskriptorius.','Be aware that any subsequent modification to the test content will not be taken into account until you publish the test again and create a new delivery.' => 'Atkreipkite dėmesį, jog betkokia testo turinio modifikacija, nebus pasiekiama vartotojui, kol nebus paskelbtas ir laikomas testas iš naujai paskelbtos pateikties.','Build a custom table with only the specific results data you are interested in and export it as a CSV file.' => 'Sukurkite norimą lentelę tik su konkrečiais rezultatų duomenimis, kuriais jūs suinteresuoti ir eksportuokite kaip CSV failą.','Build and manage tests using items that you have previously created or imported.' => 'Konstruoti ir valdyti testus, naudojant anksčiau sukurtus arba įkeltas testų dalis.','Build your test by dragging and dropping the selected items into the test pane.' => 'Konstruokite testą, tempdami ir įkeldami testo dalis į testo langą.','Choose from 17 different interaction types, including:' => 'Pasirinkite iš 17 skirtingų užduočių rūšių, įskaitant:','Control how to publish and deliver tests.' => 'Kontroliuokite kaip paskelbti ir pateikti testus.','Conversely, you can also export items from TAO and re-use them in other QTI-compliant tools.' => 'Taip pat jūs galite eksportuoti testo dalis iš TAO ir naudoti juos kitose testavimo sistemose, suderintose su QTI standartais.','Create and define test-taker records' => 'Sukurti ir nustatyti testo laikytojo įrašus','Create Items' => 'Kurti testų dalis','Create QTI Tests' => 'Sukurti QTI Testus','Create, preview and organize individual items before including them in your tests.' => 'Kurti ir koreguoti sukurtas testų dalis prieš keliant jas į testą.','Default properties of the test-takers are their name and the language of the test interface. You can customize these records by adding any data you need, such as date of birth, gender, etc.' => 'Numatytos testo laikytojų savybės yra jų vardai ir testo laikymo sąsajos kalba. Jūs galite redaguoti šiuos įrašus pridėdami duomenis, kaip gimimo data, lytis ir t.t.','Define a Delivery' => 'Nustatyti Pateiktį','Define the Test Parameters' => 'Nustatyti Testo Savybes','Determine the order of your items. Items can be displayed either randomly or in a specific order.' => 'Nustatykite klausimų eilės tvarką. Klausimai gali būti pateikiami atsitiktine arba nustatyta tvarka.','Discover how easy it is to create an assessment with TAO!' => 'Atraskite, kaip lengva atlikti vertinimą su TAO!','Do not show this window again when TAO opens.' => 'Nerodyti šio lango dar kartą, kai TAO atsidarto.','Export Test Results' => 'Eksportuoti Testo Rezultatus','For example:' => 'Pavyzdžiui:','Get started with TAO' => 'Pradėkime su TAO','Go to' => 'Eiti į','Help' => 'Pagalba','Hint: "Simple” tests without any hierarchy are also available. Note that Open Web Items (OWI) can be delivered in simple test mode only.' => 'Užuomina – Galima kurti paprastus testus be jokių hierarchinių išsišakojimų. Atminkite, kad Atvirus tinklo klausimus (angl. Open Web Items) galima kurti tik pasirinkus konstruoti paprastą testą','Hint: You can access this overview at any time via the Help button.' => 'Patarimas: Jūs galite bet kada pasiekti šią apžvalgą paspaudus Pagalbos mygtuką.','Hotspot' => 'Hotspot','If your needs go beyond what the QTI standard allows, you can develop powerful and sophisticated item types using the TAO Open Web Item format.' => 'Jeigu jūs norite kurti kitokius klausimus, nei apibrėžia QTI standartas, naudokite TAO Atvirų tinklo klausimų formatą (Open Web Item).','Import / Export Tests' => 'Importuoti / Eksportuoti Testus','Import and Export Items' => 'Importuoti ir eksportuoti klausimus','Import any items that are compliant with the QTI (Question and Test Interoperability) 2.1 standard.' => 'Importuoti klausimus, kurie atitinka QTI (Question and Test Interoperability) 2.1 standarto reikalavimus.','Import test-takers' => 'Importuoti testo laikytojus','In addition to creating test-takers individually by manually entering their corresponding data, you can mass-create test-taker records by importing them from a CSV file.' => 'Papildomai kuriant testo laikytojus individualiai rankiniu būdu įvesdami jų duomenis, jūs taip pat galite masiniu būdi sukurti testo laikytojo įrašus importuojant juos iš CSV failo.','In TAO, tests are assigned to groups.' => 'TAO platformoje, testai yra priskiriami grupėms.','Item(s)' => 'Klausimas (ai)','Manage Reports' => 'Tvarkyti Ataskaitas','Multiple choice' => 'Daugkartinis variantai','Order of items – sequential or random' => 'Klausimų tvarka – nuosekli ar atsistinktinė','Overview' => 'Apžvalga','Preview Items' => 'Peržiūrėti klausimus','Publish' => 'Paskelbti','QTI Test Structure' => 'QTI Testo Struktūra','Register your test-takers, manage their personal data, and assign them to groups.' => 'Registruokite savo testo laikytojus, tvarkykite jų asmeninius duomenis, priskirkite juos grupėms.','See how your items will appear to the test-taker before running the test. Previews are available for both desktop or mobile devices.' => 'Pasižiūrėkite, kaip klausimas bus vaizduojamas testuojamajam laikant testą. Galite pasižiūrėti, koks bus vaizdas kompiuteryje arba mobilaus įrenginio ekrane.','Select an icon on the left to find out more.' => 'Pasirink ikonelę kairėje. kad sužinotum daugiau.','Select the delivery dates.' => 'Pasirinkti pateikties datas.','Select the group(s) that will take the test. You can exclude individual test-takers even if they are part of the group.' => 'Pasirinkite grupę(-es), kurios laikys testą. Jūs galite išskirti individualius testo laikytojus, netgi kai jie yra grupėje.','Select the test you want to deliver to your group(s) of test-takers. Publish it to make it available online.' => 'Pasirinkite testą, kurį norite pateikti jūsų testo laikytojų grupei(-ėms). Paskelbkite, kad būtų prieinami laikyti.','selection' => 'pasirinkimas','Single choice' => 'Vienas variantas','Specify how many times test-takers are allowed to repeat a test.' => 'Nurodykite, kiek kartų testo laikytojui galima kartoti testą.','Store, manage, and analyze test results with ease.' => 'Lengvai laikyk, tvarkyk ir analizuok testų rezultatus.','Test part(s)' => 'Testo dalis(–ys)','Test section(s)' => 'Testo skyrius(–iai)','Text entry' => 'Teksto įvestis','Time limit' => 'Laiko limitas','To create a QTI test:' => 'QTI testo kūrimui:','Use Groups to Manage Test-Takers' => 'Naudoti Grupes Testo Laikytojų Tvarkymui','Videos' => 'Vaizdo įrašai','View the performance of any individual test-taker – whether it’s on a single test or across a range of tests.' => 'Peržiūrėkite kiekvieno individualaus testo laikytojo testo našumą, kai laikomas vienas testas arba visą eilę testų.','You can also add rich media content to your items, such as photos, math formulas and video.' => 'Jūs taip pat galite pridėti medijos turinį jūsų klausimams, kaip nuotraukos, matematinės formulės ir vaizdo įrašai.','You can create tests in compliance with the QTI 2.1 standard. A QTI test is structured as follows:' => 'Jūs galite kurti testus atitinkamus QTI 2.1 standartui. QTI testo struktūra sudaryta iš:','You can specify test settings such as:' => 'Jūs galite nurodyti testo nustatymus, tokius kaip:');